import css from "./WhatWeDo.css";
import Button from "../Button/Button.js";

const WhatWeDo = props => (
  <div style={props.style} className={`${css.WhatWeDo} ${props.flexClass}`}>
    <div className={css.pic}>
    </div>
    <div className={css.halfContainer}>
        <h2 className={css.sectionTitle}><span className={css.what}>{props.titleFirstWord}</span> {props.restOfTitle}</h2>
        <p className={css.paragraph}>We build and maintain:</p>
        <p className={css.paragraph}>Web Front-ends with HTML, CSS, and a library called React.</p>
        <p className={css.paragraph}>Web Back-ends using NodeJS, Ruby on Rails, PHP, MySQL, AWS, and Heroku.</p>
        <p className={css.paragraph}>Custom Websites from the ground up as opposed to using pre-existing templates.</p>
        <Button text="Get A Quote"/>
    </div>
</div>
);

export default WhatWeDo;
